import NavbarLogin from "./components/navbarLogin";
import Footer from "./components/footer";
import { useState } from "react";
import { useEffect } from "react";
import { API } from "./config/api";
import  TrasactionCard from'./transaction-card'


function Transactions(){
 
  const [user, setUser] = useState([]);
  const [trips, setTrips] = useState([]);
  const [transaction, setTransaction] = useState([]);
    // Create function get products data from database here ...
    const getUser = async () => {
      try {
        const response = await API.get("/users");
        setUser(response.data.data);
      } catch (error) {
        console.log(error);
      }
    };
    // Call function get products with useEffect didMount here ...
    useEffect(() => {
      getUser();
    }, []);
    const getTrips = async () => {
      try {
        const response = await API.get("/trips");
        setTrips(response.data.data);
      } catch (error) {
        console.log(error);
      }
    };
    // Call function get products with useEffect didMount here ...
    useEffect(() => {
      getTrips();
    }, []);
    const getTransaction = async () => {
      try {
        const response = await API.get("/transactions");
        setTransaction(response.data.data);
      } catch (error) {
        console.log(error);
      }
    };
    // Call function get products with useEffect didMount here ...
    useEffect(() => {
      getTransaction();
    }, []);
    
 const data = useState({
    status:transaction.status,
    attachment:transaction.attachment
 })
console.log(user.name)
    return(
        <>
            <NavbarLogin/>
            <div id="card">
            <table class="table table-striped" style={{width:700,marginLeft:400,marginTop:100}}>
  <thead>
    <tr>
      <th scope="col">No</th>
      <th scope="col">Users</th>
      <th scope="col">Trip</th>
      <th scope="col">Bukti Transfer</th>
      <th scope="col">Status Payment</th>
      <th scope="col">Action</th>
    </tr>
  </thead>
  <tbody>
  {data.map((props) => (<TrasactionCard status={transaction.status} />))}
  </tbody>
</table>
            </div>

            <Footer/>
        </>
    )
}
export default Transactions
